import React, { Component } from "react";
import Slider from "react-slick";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };
    return (
      <div>
        <Slider {...settings}>
          <img src="../" alt="image 1" />
          <img src="image2.jpg" alt="image 2" />
          <img src="image3.jpg" alt="image 3" />
        </Slider>
      </div>
    );
  }
}
